import React from 'react';
import '../styles/programmingStyles/programming.scss';
import AOS from "aos";
import { FcApproval } from "react-icons/fc";
import "aos/dist/aos.css";

function ProgrammingSkill(skill) {
    AOS.init({
        duration: 2000
    })
    return (

        // <div></div>
            <ul className="programming-list">
                <li className="programming-item" data-aos="zoom-out">
                    <p>{skill.skill}</p>
                    <p className="showItem"><FcApproval /></p>
                </li>
           </ul>

    )
}

export default ProgrammingSkill;
